(1, '2022-02-10 01:26:05', '2022-02-10 01:26:05', NULL, 'Buyers and sellers', 'If you don\'t know of a great real estate agent in your area, or an area your moving to, we can help. We will connect you with three of the top agents in your area and, if you choose to work with one of them, we pay YOU! We pay you, upon successful sale or purchase, 10% of the real estate commission payable to the agent you have selected.', 'images/BJs8xpFcVoEsVo0NvsvJHBeineLUxHDdOJZgqoCe.png');
