(1, '2022-02-10 00:58:42', '2022-02-10 01:33:58', NULL, 'Real estate agents', 'We have organized a centralized collection of vetted real estate agents nationwide who have agreed to pay to give and receive referrals. 100% of the agents we partner with have agreed to pay you 25% of their respective real estate commissions, upon the completion of a successful sale transaction, to any licensed referral partner. It\' s easy, just sign up, give and receive referrals, make more money, and get more clients.', 'images/rHhMvpcpAKQZ4ehf8NSN8MCqfnbb2YEB02pkmm9q.png');
