(1, 1, NULL, NULL, NULL, 'no_avatar.jpg', NULL, NULL, NULL, NULL, NULL, NULL, '', '2022-01-19 03:44:36', '2022-01-19 03:44:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'data:image/octet-stream;base64,', 'images/companyLogo.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
