(42, 63, NULL, NULL, NULL, 'uzz3we3MUA.jpg', 'USA', 'Co', 'Golden', '18905 W 55th Circle', '80403', '39.755543', '-105.2210997', '2022-04-22 00:12:08', '2023-09-14 01:12:19', '(303) 478 - 3083', 'MB COBB HOME TEAM LLC', '18905 W 55th Circle', 'ER100047349', 'Matthew Cobb', 'Golden, CO, USA', 'www.cobbhometeam.com', '(303) 478 - 3083', 'Co', 'data:image/octet-stream;base64,', 'images/RWOzwJRXMi8B9bMuw7b1hYnXh1RHwWYoVSVd9k9X.jpg', 'I love referrals!  If you are looking for a top producing, experienced and educated agent to help your clients look no further.  Extensive experience including corporate relocation, military relocation, second home purchase, investment purchase and disposal, and luxury purchase within all of the Denver/Golden/Boulder locals.  Reach out today to find out how I can help you and your clients exceed your real estate goals.  \r\n\r\nI also own and operate Referral-agent.com.  I started and developed this website as a tool for agents who work with referrals because of my extensive success and experience with both sides of the referral industry.  Please allow this platform and my extensive experience to help guide and inform you and your clients toward a successful referral relationship for EVERYONE!\r\n\r\n303-478-3083\r\nmatt@cobbhometeam.com', 'basic', '0', '0', '4427 4250 6500 4760', '3', '27', '110', 'matt@cobbhometeam.com'),
(43, 64, NULL, NULL, NULL, 'hKgRvBb0Vt.png', 'Illum deserunt irur', '', NULL, NULL, NULL, '37.09024', '-95.712891', '2022-04-22 00:15:02', '2022-05-21 02:22:48', '+1 (182) 222-4193', 'Calhoun Delacruz LLC', 'Wells and Whitaker LLC', '123', 'Hollee Preston', 'Illum deserunt irur', 'https://www.tizokararo.co.uk', 'Johns and Whitfield Inc', 'Tempor officia nostr', 'data:image/octet-stream;base64,', 'images/A4rOjFKxj1k8SI6twEcS8b2CJtObXs9atAZIxMZK.png', 'Autem eius quo et ve', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(44, 65, NULL, NULL, NULL, '1jBX0VRz9a.jpg', ' USA', ' CO', NULL, NULL, NULL, '39.755543', '-105.2210997', '2022-04-28 22:48:24', '2022-09-14 23:48:04', '(513) 368 - 4372', 'MB COBB HOME TEAM LLC', '18905 W 55th Circle', 'ER100047349', 'Matthew Cobb', 'Golden, CO, USA', 'www.cobbhometeam.com', '(130) 347 - 8308', 'Co', 'data:image/octet-stream;base64,', 'images/5y81qRdqCWtSim4grMtDUJUyP08MSsJ92szUVKVs.jpg', 'My name is Maura Cobb and I love real estate!  My husband Matthew Cobb and I have been investors and agents in Colorado for a combined 25 years.  Prior to making the move to be a Realtor full time, I was in Sales and Relationship Management for 16 years in the financial sector.  Specifically, my role was focused on payment processing and financial institutions were my clients.  This corporate background gave me a wealth of experience calling on C-level executives, contract negotiations, relationship management and client retention, and more.  This past experience helps me with my client relationships and negotiation with real estate transactions.  In addition to buying and selling real estate with my husband, we also enjoy renovation of homes.  We currently own multiple rental properties in Denver, Westminster, Wheat Ridge, Arvada, and Boulder.  I also enjoy design, staging, and decorating.  Home decorating has been a passion of mine since I was in elementary school.  \r\n\r\nIt brings me a lot of joy to help my clients find the perfect home.  I take a lot of pride in listening to my clients needs and helping them find a place to call home.  In addition, I also enjoy working with investors and finding income properties.  \r\n\r\nMy family and I currently reside in Applewood, but lived in the Highlands / Sloans Lake area for about 8 years prior to moving to our current neighborhood.  We have two boys, Will and Wyatt.  In my free time, I enjoy spending time with my family, hiking, yoga, skiing, cooking, and eating at new restaurants.  \r\n\r\nI would love to talk to you about your Real Estate needs!  Please contact me at the information below.  \r\n\r\nMaura Cobb\r\n303-321-0377', 'basic', '0', '0', '4427 4250 6500 4760', '3', '27', '110', 'maurajcobb@gmail.com');
