(60, 81, NULL, NULL, NULL, 'aPWSeg5NLI.jpg', ' USA', ' CO', NULL, NULL, NULL, '39.755543', '-105.2210997', '2022-05-12 04:55:50', '2022-05-12 04:55:50', '(970) 261-8402', 'Berkshire Hathaway Home Services Colorado Real Estate', '2460 W. 26th Ave C-120', '100082300', 'Ryan Shulz', 'Golden, CO, USA', 'www.DDRocksRE.com', '(970) 261-8402', 'CO', 'data:image/octet-stream;base64,', 'images/DBNq8GDKr0PdrSsTAoDHAygdxfMNIxBRO5QCR13q.tif', 'I am passionate about helping my clients to find Home and to maximize their investments.  I am an SRS, RENE, CSA and Realtor with an amazing company.  I offer all of my clients a Home Warranty with their purchase as a gift and work with a very special team to provide excellent results and legendary customer service.  I am happy to offer a 30% referral fee.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
