(61, 82, NULL, NULL, NULL, 'lCaWfi1KH1.jpg', ' USA', 'Rhode Island', NULL, NULL, NULL, '41.5800945', '-71.4774291', '2022-05-12 05:18:07', '2022-05-12 05:18:07', '+14016025162', 'Keller Williams Coastal', '47 Valley Road Middletown, RI02837', 'RES 0030662', 'Jenn Bo e', 'Rhode Island, USA', 'https://www.traciehallrealestate.com/', '+14016025162', 'RI', 'data:image/octet-stream;base64,', 'images/9ZwBIxsoVINo1hcCZlIh51nqZukU396ku1TuY8rw.png', 'In the luxury real estate market, Tracie Hall is a nationally recognized agent with Keller Williams Coastal and known for selling the 2021 HGTV Dream Home. She is renowned among her clients and colleagues alike for her integrity, loyalty and professionalism.Tracie is committed to providing the attention to detail that the modern, savvy and discerning client deserves. \r\n\r\nTracie brings to her real estate career over 20 years of sales, marketing and customer service. She is known for selling some of the most prestigious properties in Rhode Island, however her expertise extends across all neighborhoods and property types, giving her a unique ability to present her clients with specific information as well as real-time market overviews and analyzed data. She goes above the status quo to help her clients. \r\n\r\nTracie\'s progression into real estate was natural, as her mother was a successful real estate broker and her father a builder. She learned from a young age that a strong work ethic, effective communication and a passion for serving others is what it takes to be the best. She grew up in Central Florida and loves the coastline and the seasons for which Rhode Island is famous. Tracie has three sons of her own and is grateful to them for their tremendous love and support. \r\n\r\nWith an eye to your particular taste and needs, Tracie is ready to show you the finest listings. You can rely on her to help you realize the full potential of your real estate investment. She always successfully procures the goals of the buyers and sellers she represents. She is licensed in Rhode Island and Massachusetts.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
