(71, 94, NULL, NULL, NULL, 'T8skZ8J4RQ.jpg', 'USA', 'WI', 'Hartland', '200 E Capitol Dr', NULL, '43.105008', '-88.3420398', '2022-05-12 22:32:33', '2022-05-12 22:36:40', '(414) 897 - 1954', 'Keller Williams - Milwaukee Lake Country', '200 E Capitol Dr, Hartland WI 53029', '87225-94', 'Steph Conard', 'Hartland, WI, USA', 'damarabolton.kw.com', '(414) 897 - 1954', 'Wisconsin', 'data:image/octet-stream;base64,', 'images/sFMcNMUnsjNyzvLm6YODxzuiqWkAlhu8pnvNyYXD.jpg', 'DaMara is incredibly passionate about real estate and has quickly become one of the TOP 1% of Real Estate Agents & Realtors® in Waukesha County & Lake Country, Wisconsin. Coming from a career in the corporate manufacturing world, negotiating contracts and business analytics, she quickly found her niche -- loving all aspects of real estate, staging, design, new construction and renovation. DaMara is loyal, kind-hearted & honest while an aggressive & creative negotiator for her clients. She leaves no stone unturned and \'adequate\' isn\'t in her vocabulary. She takes service to the next level for her clients. One step ahead of the rest and your biggest advocate. Meeting new clients and forming lifelong relationships (and let’s be honest, friendships!) is her favorite part. Her motto \"Friend first, Realtor second\" comes from her experience as a client that drove her to change her career path. Through her own experience as a buyer, she found what DIDN’T work... hating the sales/pressure tactics, the lack of information/education/guidance surrounding the real estate market, and the overall lack of personal attention/relationships during one of the biggest financial decisions. DaMara vowed to never let a client of hers go through the buying or selling process without a true partner, friend, professional, and mentor. When she is not out selling homes, she and her husband Rory enjoy spending time with their two dogs Benny and Elton and renovating their home in Brookfield. Lover of classic rock (The Rolling Stones are her fav!) and all things music, travel, and great food.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
