(100, 123, NULL, NULL, NULL, '3gGVzSvNH6.jpg', 'USA', 'IA 52404', 'Cedar Rapids', '260 33rd Ave SW, Ste E', '52404', '41.9270157', '-91.69550919999999', '2022-05-18 22:27:45', '2022-05-18 22:30:39', '(319) 360 - 7139', 'WHY USA Eastern Iowa Realty', '260 33rd Ave SW, Suite E, Cedar Rapids, IA 52404', 'B39237000', 'Kevin Heinbuch', 'Cedar Rapids, IA 52404, USA', 'https://whyusa/com/kevin', '(319) 892 - 3344', 'IA', 'data:image/octet-stream;base64,', 'images/4vQD8zJLqkwhvYl7hWTpgPh1uyXvDIkDC8TbTkBy.jpg', 'Kevin Heinbuch has lived in the Cedar Rapids area since 1990. He is an Owner and Broker of WHY USA Eastern Iowa Realty and heads up The Kevin Heinbuch Team.  Kevin is an active member in the Cedar Rapids Area Association of Realtors, has served on its Board of Directors, as the MLS Committee Chair and was the Association’s President for 2011.  \r\n\r\nKevin is also one of the few real estate professionals in Iowa to have earned the National Association of Realtor’s e-Pro, Certified Residential Specialist, Short Sale and Foreclosure Resource as well as the Certified Short Sale Expert, and Certified Home Seller Advisor and Certified Home Buying Advisor designations.\r\n\r\nExperienced in financing, Kevin has access to private investors to help even those hard to finance individuals.  Kevin is also an experienced real estate investor who owns and has rehabbed numerous properties.  He even offers property management services.\r\n\r\nAs a very determined and hardworking agent, Kevin and his team help their clients determine how much home they can afford, what type of financing will work best for them, help find their dream home, and follow through to make the whole deal come together. Whether you are a first-time home buyer, looking to sell your family home, or a seasoned investor, The Kevin Heinbuch Team, will assist you in every step of your real estate transaction. \r\n\r\nCall 319-360-7139 today to see what Kevin and his team can do for you.\r\n\r\nProfessional Memberships and Designations:\r\nCedar Rapids Area Association of Realtors\r\n•	President 2011\r\n•	Board of Directors 2003-2006, 2008, 2010-2012\r\n•	Professional Standards Committee 2012-2021\r\n•	MLS Committee Member 2003-2006\r\n•	MLS Committee Chair 2007-2009\r\n•	Technology Training Committee 2008-2009\r\nIowa Association of Realtors\r\n•	IAR Legislative Committee\r\nNational Association of Realtors\r\n•	ePro (Technology Designation)\r\n•	Residential Real Estate Council \r\n•	CRS - Certified Residential Specialist\r\n•	SFR – Short Sale and Foreclosure Resource\r\nNational Association of Expert Advisors\r\n•	CHSA – Certified Home Seller Advisor\r\n•	CHBA – Certified Home Buyer Advisor\r\n•	CDPA – Certified Down Payment Advisor\r\nNational Association of REO and Short Sale Professionals\r\n•	Certified Short Sale Expert\r\n	Landlords of Linn County\r\nRECS – Real Estate Cyberspace Specialist', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
