(103, 126, NULL, NULL, NULL, 'Bveb71i6Y9.jpg', 'United States', 'WA', 'Spokane', '4407 N Division St #910', '99207', '47.6728781', '-117.5361046', '2022-05-18 23:13:51', '2023-05-20 05:34:14', '(406) 261 - 6575', 'Professional Realty Svcs', 'Spokane, WA', '135561', 'John Anderson', 'Spokane, WA 99224, USA', 'http://ZorbRealEstate.com/', 'Authentic and Ethical!', 'Washington', 'data:image/octet-stream;base64,', 'images/gJGvHEEZumk1sBpd6WwJMsMSgKnBZdctd487xk0e.jpg', 'As your Realtor, it\'s my job to represent you, and look out for your interests! From start to finish, I work diligently on your behalf, guiding you through the entire real estate transaction. If you are buying, the goal is to help you find the property that fits your needs. If you are selling, the goal is to get you the most return on your investment while working within your timeline.\r\n\r\nAs a seasoned Real Estate Advisor, I have first-hand experience buying/selling homes, land, new construction; 1031 Exchanges, relocations, PCS moves, and VA Benefits. Client focused and service oriented, I provide all levels of Professional Real Estate Services and am happy to put my knowledge and years of experience to work for you.\r\n\r\nWorking together, we can make your real estate experience a success!', 'yearly', '2023-05-19', '2024-05-19', '4339 9315 2651 5473', '2', '27', '679', 'KZorbRealEstate@gmail.com'),
