(108, 131, NULL, NULL, NULL, 'j2rPcMbIhh.jpg', 'San Diego & Temecula', '', NULL, NULL, NULL, NULL, NULL, '2022-05-19 01:43:41', '2022-05-19 01:43:41', '(858) 531 - 4804', 'eXp', '2603 Camino Ramon Suite 200, San Ramon, CA 94583', '02005457', 'Deborah Penny', 'San Diego & Temecula', 'www.BrantasticHomes.com', '(888) 832 - 7179', 'CA', 'data:image/octet-stream;base64,', 'images/fDejZuVcHZ4hZfMZPSxKFYwk6aNo7BtLaKO5ksk6.jpg', 'Hello! I’m a residential Realtor® who works with home buyers and sellers in the San Diego and Temecula areas of southern California.\r\n\r\nAs your real estate agent, I have three primary goals: to always LISTEN to your concerns, to put YOUR NEEDS ahead of my own, and to keep the lines of COMMUNICATION open at all times. Whether you’re a first-time buyer, new to the area, or ready to make a move to your next home, I can help! Let’s talk today and strategize how we can make your dreams a reality and get you the best value for your real estate dollars.\r\n\r\nI’m a military spouse who loves helping VA and CalVet families like my own. When I’m not working, I live in Escondido with my husband and our two rescue dogs. I have past experience as a mortgage lender and a law degree from the University of San Diego.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(109, 132, NULL, NULL, NULL, 'L2j6xRdTIW.png', ' USA', ' TX', NULL, NULL, NULL, '29.4251905', '-98.4945922', '2022-05-19 04:17:15', '2023-05-20 05:34:16', '(210) 218 - 8157', 'REAL Brokerage', '27 W 24th St, Ste 407, New York, NY', '0742644', 'Michael Yarrito', 'San Antonio, TX, USA', NULL, '(512) 960 - 3253', 'TX', 'data:image/octet-stream;base64,', 'images/vT4LEJhFA5zARUimgwwk8DeLAQGz1pn88FD4UpwU.png', '\"My true passion is providing white glove service with a down home feel. I go beyond the call of dust for my clients and the joy I get from their happiness is immeasurable. I\'m committed to my clients dreams and best interest while buying, selling, or leasing properties.\"', 'basic', '0', '0', '5155 9775 8265 5206', '4', '24', '409', 'eugenio@soldwithgene.com');
