(110, 133, NULL, NULL, NULL, 'cn2I0KeKo5.png', ' USA', ' FL', NULL, NULL, NULL, '27.876394', '-82.7778579', '2022-05-19 06:42:12', '2022-05-19 06:42:12', '(727) 317 - 7653', 'Personal Realty Advisers', '532 6th Ave. N., St. Petersburg, FL 33701', 'BK3385588', 'Robert Coscia', 'Pinellas County, FL, USA', 'https://www.personalrealtyadvisers.com/', '(727) 317 - 7653', 'Florida', 'data:image/octet-stream;base64,', 'images/Va3buCYI1JafPynPAZ9flnZqgxLckvo1tOsTpIf1.png', 'KEYS TO OUR WORK:\r\n1) Clients working with us will work directly with me, the Broker and Brokerage Owner (not a mid-level sales agent).\r\n2) We work with no more than 5 clients at any one time, so we can give every client our full attention and effort.\r\n\r\nI have been working in real estate for more than 35 years all along the Florida Gulf Coast, and I have been a Broker and Brokerage Owner for more than 15 years. My family has been doing this work since 1921 (4 Generations!)\r\n\r\nI have earned some of the highest and toughest real estate certifications, because I am committed to learning about specialty needs and service areas that will benefit my clients.\r\n\r\nClients also will work with my partner Beth, a retired university professor; now Realtor. She specializes in research and promotion--important for all of our work with clients.\r\n\r\nWhether you are buying, selling or investing, we will provide expert guidance and hands-on assistance. We look forward to hearing from you soon.\r\n\r\nDistinti Saluti.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(111, 135, NULL, NULL, NULL, '9anrIu6hwu.jpg', ' USA', ' VA', NULL, NULL, NULL, '38.8799697', '-77.1067698', '2022-05-19 07:08:43', '2022-05-19 07:08:43', '(571) 331 - 1255', 'Cardinal Realty Brokerage Corp.', '8130 Boone Blvd. Ste. 240, Vienna, VA 22182', '0225184761', 'Tanya Tran', 'Arlington, VA, USA', 'www.realestatevadc.com', '703-574-1232', 'Virginia', 'data:image/octet-stream;base64,', 'images/d1Y7t4RvZxceci2yRBme4GjWEqik37spzEjCE0c0.png', 'Cardinal Realty Brokerage Corporation is located in Vienna, Virginia, USA. This organization primarily operates in the Real Estate Residential/Commercial /Business Brokerage industry within the Real Estate sector. Representing clients to buy, to sell and to lease properties from single home, townhome, condo to commercial property and established businesses such as restaurant, beauty salon, convenient store, auto repair facility......etc. As a former Manager of big box Retail Store: The Home Depot for 12 years and as Realtor for the last 15 years and still counting, I have helped many happy clients in which I have the privileges to also help many of my client\'s referrals from their family members to their relatives, friends, co-workers....., and that\'s a badge of honor for me in this profession as that shows the trust my clients had have for me. I would love to connect and to work with people that refer their trusted clients that would come to my areas of services: Northern Virginia counties, Maryland counties around the capitol beltway and Washington DC. Not only to successfully representing the referred clients but to make you, the referrers to be proud of the choice you have made for your clients. Welcome and I look forward to connect with everyone to achieve their client\'s goals!', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(112, 136, NULL, NULL, NULL, 'tQdc9NvhYQ.jpg', ' USA', ' CO', NULL, NULL, NULL, '39.7392358', '-104.990251', '2022-05-20 11:26:32', '2022-05-20 11:26:32', '(303) 478 - 3083', 'Cobb Home Team', 'webmaster@referral-agent.com', '04734P', 'Matthew Cobb', 'Denver, CO, USA', 'www.cobbhometeam.com', '(303) 478 - 3083', 'C0', 'data:image/octet-stream;base64,', 'images/SmtsuTS5l26COSb8rOnRUlg99EIcVj8qK1NUTjnI.jpg', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
