(113, 137, NULL, NULL, NULL, 'oD73WkgGXN.jpg', ' USA', 'Minnesota', NULL, NULL, NULL, '46.729553', '-94.6858998', '2022-05-20 11:53:39', '2022-05-20 11:53:39', '(612) 327 - 1519', 'RE/MAX Results', '7373 Kirkwood Ct N #300, Maple Grove, MN 55428', '40430782', 'Becky O’Brien Group', 'Minnesota, USA', 'WWW.BeckyOBrienGroup.COM', '(763) 235 - 7000', 'Minnesota', 'data:image/octet-stream;base64,', 'images/KHvVrGURZk2M6Kb1kVEI41nAVHdt04XlPBTCKE3Z.png', 'Hey everyone I am a Realtor here in MN. Serving Buyers & Sellers in the NW Suburbs of Minneapolis.\r\nI’ve been in real estate for 7+ years and have been with the same team continuously learning and growing with the best, Becky O’Brien Group of RE/MAX Results. \r\nGuiding Buyers and Sellers through the unknown in real estate is my passion. I nurture my clients until they’re ready to make the move. I can promise you all referrals will be very well represented in a smooth transaction. Please reach out if I can help.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
