(122, 146, NULL, NULL, NULL, 'nCCoRAEsN4.jpg', ' USA', ' AZ', NULL, NULL, NULL, '33.4483771', '-112.0740373', '2022-05-24 23:27:40', '2022-05-24 23:27:40', '(303) 521 - 6440', 'X-SELL PROPERTIES', '8235 East Sierra Pinta Drive', 'BR115405000', 'Vicki Schmidt', 'Phoenix, AZ, USA', NULL, '(480) 998 - 2611', 'AZ', 'data:image/octet-stream;base64,', 'images/qtqQZodEgHAkSsxgwXgRQlHREffcqt24FoTTLgak.png', 'Selling properties in the Phoenix Metro area and all surrounding areas for over 20 years.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(123, 147, NULL, NULL, NULL, 'WKKPvMANiF.jpg', ' USA', ' CA', NULL, NULL, NULL, '33.4936391', '-117.1483648', '2022-05-25 08:02:44', '2022-05-25 08:02:44', '(951) 375 - 8707', 'Van Dyke Real Estate', '27890 Clinton Keith Ste. D-187 Murrieta, CA 92562', '01918290', 'Frank Van Dyke', 'Temecula, CA, USA', 'www.TheVanDykeTeam.com', '(951) 375 - 8707', 'CA', 'data:image/octet-stream;base64,', 'images/kfb81Ii90BrONO1ymLdp0id5WpO09oyTWcQhjTax.png', 'I first started in Real Estate in the early 1990\'s as an investor and quickly discovered that I have a love for Real Estate. I have a passion for helping people buy, sell and invest in Real Estate. Most people hire me because my market knowledge, marketing plan and negotiation skills are unparalleled.\r\nI believe in getting my clients the best possible outcome while striving to be fair to all parties involved. Real Estate can be very daunting, emotional and stressful, and that\'s why I surround myself with a team of full-time Real Estate professionals to make sure my clients are guided through the process and every question is answered along the way, before, during and after the transaction.\r\nMy Team and I are full-time Real Estate professionals and we sell Real Estate every day. You would not trust an important operation like brain surgery to be done by a new or part-time doctor, so make sure you are choose a successful full-time Real Estate professional to handle one of the largest financial decisions you will make.\r\nVan Dyke Real Estate is one of the area\'s top Real Estate teams for a reason, with nearly all of our business coming directly from referrals and past clients who have become friends. Frank Van Dyke and Van Dyke Real Estate if the best choice for all your Real Estate needs.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
