(126, 150, NULL, NULL, NULL, 'pXv6bXw2V4.jpg', ' USA', ' CA', NULL, NULL, NULL, '32.8383828', '-116.9739167', '2022-06-01 03:35:56', '2022-06-01 03:35:56', '(619) 324 - 5397', 'Keller Williams Realty-SD East Foothills', '1030 Fletcher Parkway, El Cajon', '01889763', 'Kimo Quance', 'Santee, CA, USA', 'www.kimoquance.com', '(619) 324 - 5397', 'CA', 'data:image/octet-stream;base64,', 'images/fbqJ9Jbds55aKrslgp1z2I0xWUnsWzVeM1Ux4xPv.png', 'The Kimo Quance Group\r\nThe Team at Kimo Quance Group is committed to providing superior service to each and every client. We strive to make each experience as stress-free and enjoyable as possible, focusing on our client\'s individual needs and wishes. With an impressive amount of combined experience, our agents have become local experts for the Bay area and can be an invaluable resource when it comes to buying or selling your San Diego area home.  We will always provide expert advice to help you make the best decision for your family and work tirelessly to ensure your complete satisfaction.\r\n\r\nKimo Quance, the name and the face of the business, is a hardworking and dedicated agent with the skills and expertise needed to provide an unparalleled level of service, providing simple solutions through complex real estate matters. His years of service in the U.S. Coast Guard provided Kimo with a strong work ethic and the drive to succeed at all he does. Along with being an Amazon bestselling author, Kimo has also been featured on HGTV\'s House Hunters (3X), Tiny House Hunters, SD Luxury Listings on Fox 5, LifestylesSD, ESPN 1700 and Operation American Dream.\r\n\r\nFinding opportunities that others do not, he is able to find creative ways to bring buyers and sellers together to get deals done that normally wouldn\'t happen.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
