(131, 155, NULL, NULL, NULL, 'b4xwx3oWJj.jpg', 'USA', 'PA', NULL, NULL, NULL, '40.0378755', '-76.3055144', '2022-06-13 21:38:30', '2022-06-13 21:40:44', '(717) 314 - 7749', 'Iron Valley Real Estate of Lancaster', '101 Millersville Road, Lancaster, PA 17603', 'RS362815', 'Joseph Buchert', 'Lancaster, PA, USA', 'www.amydanzrealtor.com', '(717) 740 - 2221', '02/01/2022', 'data:image/octet-stream;base64,', 'images/DExwGpnJBskmuASXkCjTaVWnyRgqnCWUZec0dUf9.png', 'Amy is a Lancaster County Native. She has been an active member in her community for many years. She has 14 years of experience in working as a Contract Coordinator for a custom home builder in Lancaster County, and 3+ years as an Administrative Assistant at Iron Valley Real Estate of Lancaster. She has earned real-life experience in customer service, sales, marketing and legal agreements. Amy has taken her background knowledge of the real estate industry and dialed it to focus on being the hub of your experience in buying or selling a home.\r\n\r\nWhen Amy is not practicing real estate, she enjoys spending quality time with family and friends. She is a “volleyball mom” and is very active in both of her children’s lives. She also enjoys gardening, interior decorating, and is always down to host a party! Amy loves spontaneity and lives to create memories!\r\n\r\nWith a passion for service, Amy is dedicated to personalizing your real estate experience to make sure it is as seamless as possible. She listens to her clients\' wants and needs to achieve the best outcome in every transaction, and she strives to ensure that the buying or selling process is fun, easy, and stress-free. Her clients can count on her any time of day when they have a question or a concern. Most important to Amy is providing the most excellent service to buyers and sellers in order to earn their trust, referrals and repeat business. Whether you are looking to buy or sell, you can put your trust in her to negotiate on your behalf and get the deal that you deserve.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
