(132, 156, NULL, NULL, NULL, '', ' USA', ' CA', NULL, NULL, NULL, '34.0736204', '-118.4003563', '2022-06-16 22:57:47', '2022-06-16 22:57:47', '(310) 570 - 9784', 'NestSeekers International Real Estate', '271 North Canon Drive Beverly Hills, CA 90210', '01900722', 'Shawn Elliott', 'Beverly Hills, CA, USA', NULL, '(310) 278 - 8861', 'California', 'data:image/octet-stream;base64,', 'images/tO0B7DAxpue0Ix83oe802Ra2pU88KMscHIo9poot.png', 'Over the past two decades, Nest Seekers has established itself as a market leader within multiple market segments and locations, specializing in Ultra Luxury and New Development. Nest Seekers represents the most spectacular properties globally and services the needs and desires of the most sophisticated buyers and investors. Aspirational and mid-to high net-worth consumers rely on familiar and trusted brands with similar principles and identities; the Nest Seekers brand is synonymous with luxury and excellence.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
