(136, 160, NULL, NULL, NULL, '6OV2lbHiQY.jpg', ' USA', ' MI', NULL, NULL, NULL, '42.3086444', '-83.48211599999999', '2022-07-11 07:08:26', '2022-07-11 07:08:26', '(877) 297 - 3308', '24 Hour Real Estate Concierge', '3128 Walton Blvd Ste 202 Rochester Hills, MI 48309', '6502431964', 'Maria Fortner', 'Canton, MI, USA', NULL, '(877) 297 - 3308', 'Michigan', 'data:image/octet-stream;base64,', 'images/OIoCM8XjlvqAJCv0s9xkoRXl8hKG8SVEpqkIwDoU.png', '24 Hour Real Estate Concierge, \"Personal Service For Your Home Needs\" is our motto. In today\'s day and age, it\'s easy to be misled and counted as just another number. We provide 24-hour turn-around service, we can assist you with your moving costs, and we are senior and international friendly. With over 7 years in the business, we can assist with many problems including eviction, property damages, credit repair, estates, trusts and buying real estate as an investment.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(137, 161, NULL, NULL, NULL, 'csLqXomdlf.jpg', ' USA', ' LA', NULL, NULL, NULL, '29.95106579999999', '-90.0715323', '2022-07-12 12:09:50', '2022-07-12 12:09:50', '(504) 676 - 2616', 'NOLA Home Realty Group', '6109 Magazine St New Orleans, LA 70118', '995706236', 'Liz Tardo', 'New Orleans, LA, USA', 'Nolalivin.com', '(504) 676 - 2616', 'Louisiana', 'data:image/octet-stream;base64,', '', 'Originally from New Orleans, I have served as an Air Force member for over 10 years now and I am so excited to turn my passion for serving my community toward real estate. Through my military experience, I developed qualities essential to the real estate process: discipline, dependability, consistency, and attentiveness.\r\n\r\n \r\n\r\nWith a passion for service in my home state of Louisiana, I am ready to help with your home buying and selling needs. As a New Orleans native, I have the knowledge and expertise necessary for today’s fast-paced market. As a proud member of the NOLA Home Realty Group family, I carry the values of hard work, integrity, and outstanding client service into everything I do.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
