(139, 163, NULL, NULL, NULL, 'OKcjBvKDXx.jpg', 'USA', 'TX', 'Houston', NULL, NULL, '29.7604267', '-95.3698028', '2022-07-19 05:18:06', '2022-07-19 05:19:32', '(832) 576 - 4688', 'Epique Realty', '1795 N Fry Rd Ste 156 Katy Tx 77449', '773656', 'Kenneth Whitfield', 'Houston, TX, USA', 'http://shantell.epiquerealty.com/', '(512) 387 - 0722', 'Tx', 'data:image/octet-stream;base64,', '', 'Shantell Peter became a Realtor after 4 years in the Criminal Justice field. A licensed real estate agent since 2021, Shantell Peter offers clients extensive expertise as a real estate agent.\r\nBorn and raised in California, Shantell Peter has her finger on the pulse of the local real estate market. In addition to being an enthusiastic resident of Houston, TX, Shantell Peter is highly regarded by local residents and business owners and is dedicated to the success of the region.\r\nShantell Peter is characterized by honesty, truthworthy and constantly strives to help clients achieve their goals. She has been a top-performing agent at Epique Realty. Shantell Peter specializes in relocation, buyers wanting to buy, sellers wanting to sell or if you just want to lease a home.\r\nWhen Shantell Peter isn’t helping buyers and sellers achieve their real estate goals, she enjoys: cooking, eating out, shopping, going to the movies, spending time with loved ones and traveling.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
