(144, 168, NULL, NULL, NULL, 'K45QVsAzh4.jpg', 'USA', 'NY', NULL, NULL, NULL, '40.9848784', '-72.61511689999999', '2022-08-17 11:14:41', '2022-08-17 11:26:58', '(631) 629 - 6838', 'IDream Properties Powered By Exp Realty', 'Hauppauge, NY', NULL, NULL, 'Suffolk County, NY, USA', 'https://lolymarymarques.exprealty.com', NULL, 'New York', 'data:image/octet-stream;base64,', 'images/y22g7hLp59qxkxawtjQbhKVqsnFAo0zYEIXD6OFT.jpg', 'Originally from Venezuela, and with a Portuguese cultural background, Lolymary moved to New York City at the age of 18 to earn an undergraduate degree in Languages-Spanish, Economics, and secondary education from Hunter College. This knowledge, combined with a graduate dual degree in early education and special education at Touro College, has presented her with valuable communication and negotiation skills that she uses daily in the real estate world educating, guiding, and helping home buyers, sellers, sellers in distress and investors effectively creating a solution for any real estate problem that arises with different creative startegies. \r\n\r\nNYC is a fascinating place to live and work, which is why Lolymary chose to call it home. With roots in NYC, Lolymary came to the beautiful Long Island, NY about 7 years ago. She lives with her three children, her dog, and her mother, whom she cares for and supports. Lolymary is a licensed realtor in NY. As her career advanced, Lolymary acquired several designations and certifications such as Short Sales and Foreclosure SFR, e- Pro Certified, Realtors Commitment to Excellence C2EX, Express Offer certified. Also, working towards a few other designations like Price Strategies Advisor PSA, GRI, Certified International Property specialist CIPS, Probate, Commercial and Investors, as well as working towards her Florida license. In 2021, Lolymary also received the most prominent  agent award. Lolymary is passionate about real estate, creating relationships and connections with her clients, collegues, vendors and anyone that needs her help or advice, with a background in languages, economics, early education, special education, secondary education; it is very easy to see why all her clients and customers called Lolymary for help, guidance, and advice buying, selling and investing. \r\n\r\nAs buyer agent, Lolymary educates her clients of the buying process, searching for right properties, view properties, submit and negotiate offers, refers to reliable professionals: mortgage brokers, lawyers, inspectors, appraisals, survyer, contractor, homeowner insurance, movers, landscapers, etc. scheduling these people and handling communication with experts, paper works, resolving issues with inspections, etc.\r\n\r\nAs per seller agent, Lolymary educates clients of real estate market, performs a CMA to help determine selling price, help determine selling points, advises clients preparation of the home: cleaning, decluttering, staging, picture/video taking, facilitating the viewing and showings, advertising/marketing property, facilitating documents necesary, negotating offers, etc.\r\n\r\nAs a distressed seller agent, Lolymary is caring, compassionate, innovative, facilitates and educates possible solutions with creative strategies to solve seller problems. \r\n\r\nAs an Investor agent, Lolymary helps and advises investors to find, analyze, and structure  deals depending on their main focus of investment and portfolio strategies. Fascinated with building and creating projects, she finds herself collaborating with ideas on the development of projects. \r\nOutside the real estate, Lolymary has helped raise money and is still a contributor for St Jude Hospital. She has contributed monetarily to animal shelters and animal society and other organizations like “Toys for Tots”, is a helping hand to their parish when possible. She has been a member of the PTA at Saint Joan of Arc School, volunteered tutoring children in Math, languages, and loves being a part of other community events as much as possible. \r\n\r\nAsk any of her clients and they will tell you that Lolymary is very knowledgeable, enthusiastic, well prepared, extremely helpful, charesmatic, hard worker, trustworthy, friendly, inviting, funny, happy, pleasant to be around, determined, professional, honest, informative, patient, smiley, warm family like, caring, welcoming, kind, transparent, and very positive. Lolymary aims for the highest level of service to her seller, buyers, investors, lenders, vendors and takes a deep pride in helping them achieve their real estate goals. \r\n\r\nWhen Lolymary ​​isn’t working in real estate or helping, you’ll often find her often having fun, traveling or in an adventure with her children and dog or doing sports, reading, learning a new field in real estate, enjoying life and enjoying time with boyfriend, family and friends.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(145, 169, NULL, NULL, NULL, '2cjRturaIL.jpg', ' USA', ' GA', NULL, NULL, NULL, '33.7489954', '-84.3879824', '2022-08-21 13:13:50', '2022-08-21 13:13:50', '(404) 660 - 7302', 'Virtual Properties Realty', '2750 Premiere Pkwy', '352696', 'Jaime Mertz', 'Atlanta, GA, USA', NULL, '(770) 495 - 5050', 'GA', 'data:image/octet-stream;base64,', '', 'A native of the greater Atlanta Metro area I have seen lots of changes within our city and can can appreciate all that our city has to offer. I provide my clients with honesty, integrity, passion to get them the best deal while guiding them through the process. \r\n\r\nPrior to becoming a Realtor, I was a Healthcare manager which I enjoyed for over 15 years. However, I have always had a passion for helping those who wanted to become a homeowner, so I became licensed. I work hard for my clients and enjoy seeing the smiles on their faces when I am able to hand them over the keys to their brand new home. \r\n\r\nI am a mother of two beautiful active girls and enjoy traveling to any beach, hiking, baking and volunteering for various charity causes.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(146, 170, NULL, NULL, NULL, '', ' USA', ' NY', NULL, NULL, NULL, '42.88644679999999', '-78.8783689', '2022-08-22 05:03:34', '2022-08-22 05:03:34', '(716) 912 - 5389', 'HowardHanna', '6000 sheidan Dr Williamsville NY 14221', '10401258333', 'Jonathan Orlow', 'Buffalo, NY, USA', 'https://joannharig.howardhanna.com', '(716) 634 - 4200', 'New York', 'data:image/octet-stream;base64,', '', 'Jo Ann is the right choice when buying or selling in the Greater Western New York Region. Jo Ann is Full-Service, award winning Realtor who can put her expertise to work for you.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
