(157, 181, NULL, NULL, NULL, '6riQM0TKAs.jpg', 'USA', 'MO', 'Pleasant Hill', '2201 N State Route 7, Pleasant Hill, MO', '64080', '38.6574448', '-94.315422', '2022-10-08 00:51:08', '2022-10-08 01:02:36', '(816) 682 - 2382', 'ReeceNichols Shewmaker', '2201 N State Route 7, Pleasant Hill, MO', '2016005532', 'Jody Shewmaker', 'Cass County, MO, USA', 'CherylMiller.ReeceNichols.com', '(816) 540 - 5555', 'MO', 'data:image/octet-stream;base64,', 'images/rnmSjzoY4NDoL2POvpS0TKuz6QuP6u9rjagVZJm9.jpg', 'Buying or selling a home is a major life decision, that’s why I will provide my hands on assistance from beginning to end. You can also be assured that I will do everything I can to make sure your home buying or selling experience is executed in an ethical manner, with respect and integrity. Let’s sit down and discuss what your needs and interests are. I would love the opportunity to work with you and provide you with an easy, enjoyable experience and smooth sales process.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(158, 182, NULL, NULL, NULL, '', ' USA', ' MD', NULL, NULL, NULL, '39.2284408', '-76.6163555', '2022-10-15 20:45:13', '2022-10-15 20:45:13', '(301) 760 - 6229', 'EXIT Right Realty', '8730-16 Cherry Lane Laurel MD 20707', '622205', 'Carlos Landcaster', 'Brooklyn Park, MD, USA', 'cjones.findhomesinlaurelmaryland.com', '(301) 345 - 4500', 'MD', 'data:image/octet-stream;base64,', '', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(159, 183, NULL, NULL, NULL, 'R1GdGGXVGf.jpg', ' USA', ' CO', NULL, NULL, NULL, '39.4022054', '-107.2111628', '2022-10-25 01:11:08', '2022-10-25 01:11:08', '(303) 886 - 2929', 'Metro Brokers/Rocky Mountain West Real Estate', '1240 Hidden Valley Dr., Glenwood Springs, CO 81601', 'II.040018745', 'Eleanor Yeager', 'Carbondale, CO, USA', 'RockyMountainWestRE.com', '(303) 886 - 2929', 'Colorado', 'data:image/octet-stream;base64,', 'images/sDM2n9PWnQe5n8ErQCwZmt956JaLRc6ve4VqOmWv.jpg', 'Local agent serving the Roaring Fork Valley from Glenwood Springs to Aspen, Colorado. 22 years experience. Broker/Owner. I love to give my clients personal down to earth service. They can actually talk with me and I answer my phone!!', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `profiles` (`id`, `user_id`, `bio`, `gender`, `dob`, `pic`, `country`, `state`, `city`, `address`, `postal`, `lat`, `lng`, `created_at`, `updated_at`, `phone`, `brokerage_company`, `brokerage_company_address`, `license_number`, `managing_broker_name`, `agent_address`, `agent_website`, `brokerage_company_phone`, `license_state`, `signature`, `logo`, `about_us`, `subscription`, `startdate`, `enddate`, `number`, `exp_month`, `exp_year`, `cvc`, `strip_email`) VALUES
(160, 184, NULL, NULL, NULL, 'LCeyWQNrUy.jpg', 'USA', 'PA', NULL, NULL, '19422', '40.2290075', '-75.3878525', '2022-10-26 00:09:46', '2022-12-08 23:21:18', '(215) 576-5500', 'Keller Williams Real Estate', '910 Harvest Drive Suite 100, Blue Bell PA', 'RS298725', 'Harold Riley', 'Montgomery County, PA, USA', 'Harnickteam.com', '(215) 576-5500', 'PA', 'data:image/octet-stream;base64,', 'images/teTng71LatQK6todOD4GwuWYKr3UNmCamIjZzf2g.png', 'My real estate story officially began in January 1996, when I purchased my first multi-family property and began my life as a part time investor-rehabber at the tender age of 24. I was licensed in 2006 and started with a smaller regional brokerage simply to buy more properties more quickly as my dad and I built our investment portfolio - and when the crash of 2008 came I entered real estate full time as an agent. Thankfully I decided to meet with Keller Williams and haven\'t looked back! I like to say KW was not my first brokerage, and it\'ll be my last.\r\n\r\nI am a 4th generation real estate professional, as my dad is a career investor, my grandfather was a landlord/investor, and my great grandfather was a builder! I have a huge family, lots of friends, 15 years worth of real estate clientele, and great centers of influence/past clients all over the five-county area which has taken me on many journeys around the Philadelphia Metro area, and has created tremendous knowledge of the area we call the Delaware Valley/Southeastern PA. I am experienced and comfortable working throughout this entire region!\r\n\r\nHaving lived and worked in and around the Philadelphia real estate market most of my life, I understand what makes our community at large - and the people who call it “home” - so special. From the hustle of Philadelphia, to the sprawling farms of Bucks County, and the historic Main Line of Delaware County to the hills of Chester County we can help. I’ve spent a lot of time in Montgomery County in particular, as it’s where I live! I’ve gone through the schools, married my wife here, we raise our kids in these neighborhoods and in these schools, and most importantly we give back to these neighborhoods every chance we get.\r\n\r\nHelping our clients achieve their goals is a priority, whether buying, selling, investing, renting – we can help you. We have made it our business to network and connect with many contractors and professionals all over the metro area, so when you need help we can provide you with a trusted partner! We are a full service real estate team, and we have what it takes to truly be local real estate experts. Not just expertise in negotiation and marketing, but a love and understanding of our community and the people who live here. That’s just one reason to choose the Harnick Team to stand by your side – and it’s the foundation of everything I do. \r\n\r\nThank you for stopping by!', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
