(180, 204, NULL, NULL, NULL, 'oh9Q540uJj.png', ' USA', ' VA', NULL, NULL, NULL, '37.5407246', '-77.4360481', '2022-12-17 20:34:45', '2022-12-17 20:34:45', '(804) 307 - 1018', 'EXP Realty LLC', '16805 Paragon Place, Suite 41,  Richmond, Virginia', '0225182321', 'Christina Macro', 'Richmond, VA, USA', 'https://tondradevarel.exprealty.com/', '(804) 729 - 5188', 'VA', 'data:image/octet-stream;base64,', 'images/GIYs7jKUFySjaBuhhQVcqFaNaqjWyZqcJ32sWSyo.jpg', 'Tondra is a trusted expert REALTOR®, offering over 15 years of real estate experience in the Richmond, Virginia area. Tondra pride herself on being your knowledgeable, professional and supportive expert along your unique journey. Social media is changing how people do business and Tondra has gone the extra mile by completing specialized training that delivers the most advanced real estate technology to provide exceptional services that includes the online community. Plus, a REALTOR® who has designations, also has an established track record in representing the concerns of home buyers and sellers by making sure that the clients interest is the number one priority. Tondra attributes her success to the moral, intellectual, and core values that she received from her loving mother. She believes that giving back and helping others, is not only a gift, but an opportunity to share her passion, values and inspiration with others', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(181, 205, NULL, NULL, NULL, '', ' USA', ' TN', NULL, NULL, NULL, '36.1626638', '-86.7816016', '2022-12-17 20:37:12', '2022-12-17 20:37:12', '(615) 693 - 3099', 'Belwood', 'bbrewer@belwoodinvestment.com', '987456321', 'Brandon', 'Nashville, TN, USA', NULL, '(615) 693 - 3099', 'Tennessee', 'data:image/octet-stream;base64,', '', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(182, 206, NULL, NULL, NULL, '8osN4HnTFJ.png', ' USA', ' AZ', NULL, NULL, NULL, '33.4483771', '-112.0740373', '2022-12-20 03:30:55', '2022-12-20 03:30:55', '(586) 819 - 6727', 'Barrett Real Estate', '15439 S 22nd St', 'sa702599000', 'Michael Smith', 'Phoenix, AZ, USA', 'www.dogmomofaz.com', '(480) 967 - 1333', 'AZ', 'data:image/octet-stream;base64,', 'images/lU1GukTn7ebVVp8QwFb4RHLba4uGPirEXwXF80ro.png', 'I’ve worked in the real estate business since 2017, and eventually made the change to become a realtor myself.\r\n\r\nOriginally a Michigander, now living it up in the desert of AZ.\r\n\r\nIf I\'m not catching up on all the real estate hype, you can always catch me hanging out with my 5 dogs, ( yes, 5! ) sweating up a workout,\r\n\r\nmaking jewelry, DIY-ing, or just being a home body with some coffee and the furfam!', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(183, 207, NULL, NULL, NULL, 'oc5hliT1EY.jpg', ' USA', ' AK', NULL, NULL, NULL, '61.2175758', '-149.8996785', '2023-01-03 08:47:19', '2023-01-03 08:47:19', '(907) 230 - 8537', 'EXP Realty', '751 e 36th  ave #104 anchorage, ak 99503', '113536', 'Victoria Roberts', 'Anchorage, AK, USA', 'Jordan.AlaskaRealtyExperts.net', '(907) 406 - 9403', 'Alaska', 'data:image/octet-stream;base64,', 'images/2LR7cqE257OxPTvzez6SAxWuqRIxKsVb9cnKCTz1.png', 'Jordan is a lifetime Alaskan and an active duty US Air Force Veteran. Jordan quickly found his passion in real estate after the military because he found he can develop meaningful and lasting relationships with his clients. Jordan is competitive in nature and his enthusiasm is infectious!', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(184, 208, NULL, NULL, NULL, '4EXlCxGGBl.jpg', 'USA', 'NY', 'Ballston Spa', '1487 Saratoga Rd', '12020', '43.0009086', '-73.8490111', '2023-01-10 03:38:33', '2023-01-10 03:43:56', '(518) 322 - 6650', 'Sterling Homes Inc', '1487 Saratoga Rd', '10301219732', 'Lisa Licata', 'Ballston Spa, NY, USA', NULL, '(518) 688 - 2211', 'NY', 'data:image/octet-stream;base64,', 'images/rSLsAdgP1DsuNKjnzsyL2ZD7JyyHNLY3dAR69q95.jpg', 'With more than 15 years of experience in both new construction and resale homes, Kerry provides a degree of excellence like no other. She is proud to be one of the select few to represent some of the area\'s premier builders. Kerry has received recognition from the Women\'s Council of Realtors for being a \"Multi-Million Dollar Salesperson\" and in the Top 100 realtors in the area for several years. In 2021, she was the top producer at Sterling Homes Real Estate and closed the most new construction homes.\r\n\r\nOne of the most satisfying parts of being a real estate salesperson, is when a new home buyer receives the keys to their first home. Knowing their story is just beginning. Taking them through the journey of buying a home, knowing you were a part of the introduction to their new home, then the next journey of making it their own...this is the reward of the transaction. I do not discount the joy of selling a home for a client that needs to transition into a new chapter. That is rewarding as well. As a salesperson, a referral from a past or present client is the ultimate compliment. As most of my business is based on referrals, I continue to provide the best service, being as confidential and in-tune with my client’s needs.', 'yearly', '2023-01-09', '2024-01-09', '4652 9300 0131 4674', '12', '24', '192', 'Kerryloiselle518@gmail.com');
