(185, 209, NULL, NULL, NULL, 'QuXvA979qT.jpg', 'USA', 'AZ', 'Phoenix', NULL, '85016', '33.4483771', '-112.0740373', '2023-01-14 08:34:18', '2023-01-14 08:39:28', '(602) 803 - 4070', 'Keller Williams Arizona Realty', '2920 E Camelback Rd #100', 'SA669139000', 'David Morse', 'Phoenix, AZ, USA', 'www.gailsmithrealty.com', '(480) 767 - 3000', 'AZ', 'data:image/octet-stream;base64,', 'images/XLQkAchJiftQ6xSg51dPzlLRWXK0Ugpd691Ah5lh.png', 'Mountain to mountain for your Arizona needs.\r\nGoodyear to Apache Junction and everything in between we are the valley experts. Arizona property cousins can help you \r\nfind or sell your next home! www.arizonapropertycousins.com', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(186, 210, NULL, NULL, NULL, 'lVwfLyz7uP.jpg', ' USA', ' AZ', NULL, NULL, NULL, '33.4483771', '-112.0740373', '2023-01-15 04:41:41', '2023-06-23 02:00:21', '(425) 306 - 8450', 'Keller Williams Arizona Realty', '15333 N Pima Rd Suite Suite 130, Scottsdale, AZ 85260', 'SA688343000', 'Kate Matteson', 'Phoenix, AZ, USA', 'AzPropertyCousins.com', '(480) 767-3000', 'AZ', 'data:image/octet-stream;base64,', 'images/8iezAoiHLCVrPksWtmrCsn9aUZP6xz5mGFTJa6LW.jpg', 'The Arizona Property Cousins have raving fans and an impeccable reputation as an advocate, partner, and confidant. \"This team was incredible! Tammy and Gail went above and beyond the entire time! From the moment we listed coming soon to selling within hours of listing, they always supported. I was out of state and the country most of the time and Tammy and Gail took care of Everything for me! I can\'t wait to use them again on my next real estate transaction!\"\r\n\r\nGail and Tammy were practically raised as sisters in the greater Seattle area and with backgrounds in Mortgage lending and Construction industries they bring a unique perspective to the home buying and selling process.\r\n\r\nBeing anchored by Keller Williams International and Keller Williams Arizona Realty allows the Arizona Property Cousins to guide you seamlessly through the real estate process. Whether a buyer, a seller, or an investor, we think of our clients as family. Lean on us—we are here to keep the process fluid, successful, and as low-stress as possible.', 'basic', '0', '0', '4081 0440 1465 2988', '10', '25', '760', 'tammy@tammykaiserrealty.com'),
(187, 211, NULL, NULL, NULL, 'yTzdAKy9U3.jpg', ' USA', ' MI', NULL, NULL, NULL, '42.331427', '-83.0457538', '2023-01-17 02:26:10', '2023-01-17 02:26:10', '(248) 802 - 3615', 'Coldwell Banker Metro Real Estate', '1362 W Huron St', '6501417660', 'Ann Byer', 'Detroit, MI, USA', 'tnishasellshomes.com', NULL, 'Michigan', 'data:image/octet-stream;base64,', 'images/OwtELymCTUsDJ0htNTI4SUeEeCjxkKCay36yQbxZ.png', 'We are real estate experts in the Metro Detroit area who strive to provide honesty, integrity, and commitment to our clients. We are of the belief that every client is important no matter how small or large the transaction. We strive to develop and empower agents from all walks of life.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
