(193, 217, NULL, NULL, NULL, '', ' USA', ' NC', NULL, NULL, NULL, '35.7795897', '-78.6381787', '2023-01-30 00:24:10', '2023-01-30 00:24:10', '(919) 621 - 2911', 'InTrust Realty', '1504 Brightwater Ct', '264645', 'Lee Goldstein', 'Raleigh, NC, USA', 'www.lee.InTrustRealty.com', '(919) 621 - 2911', 'North Carolina', 'data:image/octet-stream;base64,', '', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(194, 218, NULL, NULL, NULL, 'MFnbVig4Lp.jpg', ' USA', ' NY', NULL, NULL, NULL, '40.8048207', '-73.3362298', '2023-01-31 23:24:59', '2023-01-31 23:27:06', '(631) 236 - 2721', 'cosentino realty group', '6 garet place 2nd flr', '30CO0823141', 'stefanie cosentino', 'Dix Hills, NY, USA', 'www.teamcosentino.com', '(631) 462 - 9200', 'new york', 'data:image/octet-stream;base64,', 'images/BynnsMFyAhICBHxHLtTUqp1Sy7XTmavxqRnwhxkk.jpg', 'At Cosentino Realty, we treat all of our clients as if they are part of our family. The time and effort we will dedicate towards achieving your real estate goals, buying or selling, is the same commitment we would put into our own. We don’t clock out at 5pm – we are always available to answer your questions or requests no matter the day. It’s more than a business relationship when you choose us – we’re there for you every step of the way.\r\n\r\nHere at Cosentino Realty Group, our in-house marketing team is what will get your home sold in a timely manner. We, unlike many teams, offer customized marketing plans that cater to each home differently. Once we discuss and develop a marketing plan that fits your needs and goals, we have our in-house marketing team putting it into gears immediately. We use many different sources of marketing from traditional mail-ins, to paid advertisements all across different social media platforms. All of the marketing tools we have to offer are just one part of the many benefits of working with us.\r\n\r\nWhile we are promoting and selling homes, we are also very tight knit with our local communities. We are always donating, contributing, and lending a helping hand to the community and anyone in need. Our goal is to benefit the community in any way possible, it\'s important to us that we stay involved and help our communities thrive as much as possible.', 'basic', '0', '0', '4563 3100 4162 5157', '12', '27', '805', 'broker3257@gmail.com'),
