(198, 223, NULL, NULL, NULL, 'v8BkYLkqMD.png', ' USA', ' WA', NULL, NULL, NULL, '46.8645747', '-122.7695986', '2023-02-24 04:25:33', '2023-02-24 04:25:33', '(253) 375 - 5366', 'Keller Williams Realty', '1029 E. Main Suite 201', '129380', 'Jim Acklin', 'Thurston County, WA, USA', NULL, '(253) 848-5304', 'WA', 'data:image/octet-stream;base64,', 'images/1URCupNsWHvz2MkPavQhNYdmwM4qrh1KLIIgoopU.jpg', 'Committed to redefining customer service standards within the industry, Carrie Johnson offers personalized realty solutions as characterized by her white-glove service as well as genuine desire to help people. Carrie Johnson has 25 years of Real Estate experience and extend her unparalleled market knowledge and expertise towards providing a positive and rewarding client experience.\r\n \r\nNo deal is too tough nor any too easy for Carrie.  Always putting her clients’ needs and happiness first, Carrie has a referral-heavy client base curated by strong relationships. Dynamic and highly resourceful, availability, responsiveness and clear-cut communication are the hallmarks of her business.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
