(199, 224, NULL, NULL, NULL, '3VZjSyMvEd.jpg', ' USA', ' NH', NULL, NULL, NULL, '42.9956397', '-71.4547891', '2023-02-28 01:42:49', '2023-02-28 01:42:49', '(603) 305 - 5274', 'Coldwell Banker', '102 Critchett Road,', '071000', 'Steve Tetrault', 'Manchester, NH, USA', NULL, '(603) 471 - 0777', 'NH', 'data:image/octet-stream;base64,', 'images/DL3R3EVpm6CiuKlTnBi2B6o2ZvdtbF1zaj7d5Yhd.png', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(200, 225, NULL, NULL, NULL, '', 'United States', 'CA', 'Whittier', '13601 E. Whittier Boulevard', '90605', '33.9791793', '-118.032844', '2023-03-02 04:29:42', '2023-03-02 04:30:50', '(562) 756 - 6465', 'Remax Classic', 'Suite 211', '01113999', 'Bob Salamone', 'Whittier, CA, USA', 'www.thegarciasteam.com', '(562) 743 - 6465', 'CA', 'data:image/octet-stream;base64,', '', 'Willie & Anna Garcia have been licensed since 1991 and are part of The Garcia Team. It would be easy to speak about all our accomplishments, our awards and trophies, etc. however we realized that throughout our extensive career, our business is truly about our clients and how we can serve them.  \r\n\r\nThis \"client first\" philosophy has always been our approach and it requires us to continually improve our skills and ways of doing business. In addition, we have found that the latest technologies are enabling us to do everything we have always done, only much more quickly and efficiently. They\'ve also helped us to extend the range of services we provide to our clients.  \r\n\r\nThere are many qualities and skills that go into being an excellent real estate professional, being of integrity, in depth community and market knowledge, marketing savvy, effective negotiation skills and a high-quality professional network, all of which are hallmarks of how we work.  \r\n\r\nThat said, in our experience as real estate professionals, we found that providing the very best service is essentially about putting our clients first. This means keeping ourselves accessible, being good listeners as well as good communicators, and responding quickly to your needs. \r\n\r\nSo when you decide that you\'d like to buy or sell a home in Whittier or the surrounding cities in the Los Angeles and Orange County area, please contact us. Our team is also bilingual (Spanish).WW', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(201, 226, NULL, NULL, NULL, 'ElR5NIRkJD.jpg', 'USA', 'GA', NULL, NULL, '30213', '33.5670562', '-84.5810418', '2023-03-07 20:57:38', '2023-03-07 21:00:33', '(678) 895 - 1047', 'Southlake Realty of Atlanta, LLC', 'Campbellton Fairburn Rd', '255539', 'Tosha Thornton', 'Fairburn, GA, USA', 'www.southlakerealtyatl.org', '(770) 742 - 8849', 'GA', 'data:image/octet-stream;base64,', 'images/DbyhjKhNiisZkpChSgFZA046xTvK8CdGU7TTZXWG.jpg', 'I founded Southlake Realty of Atlanta, LLC in 2006. My career first began in 1996 as a Property Manager, managing over 1000 units in Southwest Atlanta. I decided to obtain my real estate license in 2002 and in my first year of sales, I was recognized as a top million-dollar sales agent and my sales continue to increase each year.  Three years after obtaining my license, I advanced my education to become a Broker, which is my current professional focus. I am a licensed Real Estate Broker serving in the real estate market primarily as a buyers’ agent, but of course, I am constantly working in the various arenas of real estate.\r\nIn addition to be being a Realtor and Broker, I am a Military Relocation Professional, an REO Specialist, and a Certified Housing Credit \r\nProfessional. I am a member of the West Georgia Board of Realtors and I am also affiliated with the National Association of Professional Women. The great news is that my credentials don’t stand alone and there are several other reasons I would be a great choice as your real estate professional.\r\nMy personal and professional qualities will assist to meet all of your real estate needs. I am eager to educate individuals and families on their journey as they acquire homes, commercial and investment properties. I guarantee I will always be an advocate for you. Whether you are buying, selling, or renting, I will work tirelessly to promote your best interest. My ability to effectively connect and communicate with a diverse group of individuals, from the veteran investor to the first-time homebuyer, has been a proven success.\r\nMy philosophy is simple - I understand and care about every client.  I make a commitment to you and your entire family.  Any real estate office can sell houses, but I strive to find homes and neighborhoods that help my clients fulfill their real estate dreams! \r\nIt is the basis upon which trusted referrals are sent.  It is the extra care and personal touch that represents my attitude and style.  I am dedicated to serving you with the highest level of respect. It’s your dream, our journey, to greater investments.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
