(205, 230, NULL, NULL, NULL, '4C75D6uPoF.jpg', ' USA', ' FL', NULL, NULL, NULL, '27.4989278', '-82.5748194', '2023-03-22 09:40:43', '2023-03-22 09:40:43', '(813) 470 - 0047', 'Century 21 Beggins', '1626 Ringling Blvd S 101', 'SL3185706', 'Craig Beggins', 'Bradenton, FL, USA', 'Capecodtofloridarealestate.com', '(813) 470 - 0047', 'Florida and Massachusetts', 'data:image/octet-stream;base64,', 'images/kZ3h0hmvPXt8SxYSkSChfxzlDLujOp331hsthke1.jpg', 'KATHLEEN D LONG PA\r\n1626 Ringling Boulevard \r\nSuite 101 Sarasota FL34236\r\n             \r\n           CapeCodToFlorida Realtor@gmail.com\r\n              Direct: 813.470.0047\r\n\r\nMISSION STATEMENT-\r\nAs a Florida and Massachusetts licensed\r\n attorney, Florida Licensed Realtor, and former Assistant State Attorney, I am committed to public service, community service and planned development by excellence in service. Through partnering with local and state community leaders to provide pro-bono and community service projects, our agents, sellers and buyers are represented with the highest ethical standards. \r\n\r\n2012 - Present -  \r\nAttorney/Manager/Realtor Century 21 -  Sarasota & Longboat Key Florida. Multimillion brokerage closing fifty-five homes a day, consistently ranked #13 Florida Century 21 brokerage. Ranked Best Workplace by Tampa Bay Times 15 years in a row! Corporate Sponsors for Toys 4Tots and Easter Seals! Manage two offices while successfully maximizing agent and staff legal training in contracts management, real estate property closing management training, and have doubled AGR profit margins. \r\nDaily contract negotiations, evaluation and training of realtors, extensive pro-bono services to seniors and children in need. Work with law enforcement to stamp out Elder Fraud and Exploitation. Recent award for client achieved over $178,000.\r\nOutstanding Customer Quality Service Pinnacle Award, Masters Award for Real Estate services to Sellers and Buyers resale inventory and new construction, waterfront properties, land sales, inventory. Business development sales, probate, and vacation home sales.\r\n \r\n\r\n2008 - 2012 - Litigated cases in 13thJudicial Circuit Hillsborough County Florida.County, Juvenile and Felony Court Divisions. Managed large staff, personal caseload of five hundred plus cases per month Felony and Misdemeanor and Juvenile Cases. 2012 Ethics & Professionalism Award, 13thJudicial Circuit Hillsborugh County Florida. \r\n\r\n1997 - 2007 - 13thJudicial Circuit Hillsborugh County Florida.\r\nJudicial Law Clerk. Managed large court staff, dockets, prepared legal memoranda on numerous legal issues in Civil and Criminal Court Divisions. \r\nAchieved B.S Liberal Arts & Law, J.D. evenings; working 60 hours a week employed full-time days and weekends. \r\nAwarded Faculty Professionalism Award & Member HALSA, ADR and Honors Internship to Judges Barton, Greco, Holder, Isom.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
