(209, 234, NULL, NULL, NULL, 'ORFo5Y4Mvp.jpg', 'United States', 'NY', 'Tonawanda', '2211 Sheridan Dr', '14223', '42.93975529999999', '-78.8099472', '2023-04-27 02:26:44', '2023-08-31 05:00:35', '(716) 430 - 2091', 'WNY Metro Roberts Realty', '2211 Sheridan Dr', '10301217766', 'WNY Metro Roberts Reality', 'Cheektowaga, NY 14215, USA', 'https://emmanuelwilliams.metrorobertsrealestate.com/', NULL, 'NY', 'data:image/octet-stream;base64,', 'images/07azW5FXlGTbzHpBxPhpkUORAG9XUPsCZ6fnErWl.png', 'As an experienced and dedicated associate broker with expertise in both residential and commercial real estate, he is committed to helping his clients buy or sell their properties with the highest level of expertise in the local market. With a remarkable track record of delivering results, he prides himself on being honest, trustworthy, and knowledgeable in the real estate market.\r\n\r\nWhether the client is an experienced investor or a first-time buyer, he can guide them through the process and help them achieve their real estate goals. He understands how important it is to find the right property and get the best offer, and he makes it his responsibility to help his clients succeed.\r\n\r\nAs a commercial broker, he has the experience and knowledge to help clients navigate the complexities of commercial real estate transactions. Whether they\'re looking for a retail space, office building, or industrial property, he can help them find the right property to meet their business needs.\r\n\r\nClients can count on him to always do what\'s in their best interest. He believes that nothing is more gratifying than helping people meet their real estate needs. That\'s why he is there to help them every step of the way, whether they prefer to browse his website or set up an appointment with him.\r\n\r\nIf someone is looking for a committed and knowledgeable associate broker who can help them with both residential and commercial real estate, he invites them to contact him today. Let\'s work together to make their real estate dreams a reality.', 'basic', '0', '0', '4258 0945 0316 1964', '1', '27', '969', 'Eew.estate@gmail.com'),
(210, 235, NULL, NULL, NULL, 'O9aaeV9qDj.jpg', ' USA', ' AL', NULL, NULL, NULL, '32.4640245', '-86.4596966', '2023-05-24 20:27:03', '2023-05-24 20:27:03', '(904) 295 - 4964', 'RealtySouth', '2003 7th Street North, Clanton AL 35045', '142278', 'Diane Knight', 'Prattville, AL, USA', 'pamelahall.realtysouth.com', '(205) 755 - 7719', 'Alabama', 'data:image/octet-stream;base64,', 'images/dwadCftM7Yq2ESf5lX6Lt8MOlKxJemY7pABBU8WE.jpg', NULL, 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL),
(211, 236, NULL, NULL, NULL, 'ZawLDsF9b2.jpg', ' USA', ' CO', NULL, NULL, NULL, '39.7392358', '-104.990251', '2023-05-29 11:22:36', '2023-05-29 11:22:36', '(303) 378 - 2320', 'Real Brokerage LLC', '1351 E Nichols Ave', '039643', 'Dustin Ventuerla', 'Denver, CO, USA', 'Www.milehighhomesales.com', '(503) 378 - 2320', 'CO', 'data:image/octet-stream;base64,', 'images/C1XdoBAQkzfqt7ntQUgDUzyCBXqwScd5gkVvxDKv.jpg', 'Our team is led by Broker-Associate, Laurie Stoessel. Laurie is a Colorado native. She is a Broker Associate with Real Broker LLC with over 16 years of real estate experience. Recently our team has made an exciting move to Real Broker LLC.  During our time at Remax Laurie had been a leading top producer in her office earning national awards including: Remax Platinum Club, 5280 Five Star Real Estate Agent Award, and Top Ten Team Leaders in the Remax Mountain Region States.\r\n\r\nFor over 16 years Mile High Home Sales and Laurie Stoessel have provided the Denver community with the highest level customer service.  That is the mission and belief system behind every house we sell.  Our clients always walk away happy and satisfied because they know we are dedicated to servicing their every need. This dedication comes from our deep understanding that a person\'s home is a vehicle to their wealth and stability.', 'basic', '0', '0', NULL, NULL, NULL, NULL, NULL);
