INSERT INTO `what_we_dos` (`id`, `created_at`, `updated_at`, `deleted_at`, `title`, `description`, `image`) VALUES
(1, '2022-02-10 00:57:10', '2022-06-08 23:56:15', NULL, 'HOW IT WORKS', 'We exist to connect real estate agents. Our network of agents is here to help your clients buy and sell within the United States of America.  All of our partner agents agree to give 25% of their side of the commission to the agent who referred the business upon completion of a successful sale.  Referral-Agent  will never charge to give or receive leads.   Sign up, give and receive more referrals, help more clients, and make more money with Referral-Agent.com.', 'whatwedo/ayBcZWHW7T1M2XJNOimjq76KLUMfzdufKONXNlJj.png');
